import styled from 'styled-components';


const CollectionItemStyles = styled.div`
  background: #ced8ec;
  padding: 2rem;
  text-align: center;
  text-decoration: none;\

  .collection-item-title {
    text-transform: uppercase;
    color: blue;
  }
`;

export { CollectionItemStyles };
